    /**
     * 将文件转换成Base64编码
     * 将文件转化为字节数组字符串，并对其进行Base64编码处理
     *
     * @param localFilePath 待处理图片
     */
    public static String getFileBase64StrByLocalFile(String localFilePath) {
        InputStream in;
        byte[] data = null;
        // 读取图片字节数组
        try {
            in = new FileInputStream(localFilePath);
            data = new byte[in.available()];
            in.read(data);
            in.close();
        } catch (IOException e) {
            e.printStackTrace();
        }
        return new String(Objects.requireNonNull(Base64.encodeBase64(data)));
    }

    @Test
    public void generateAsBase64Test() {
        // 网址读取转base64图片流
        String base64 = QrCodeSeniorUtil.generateAsBase64("http://baidu.com/", new QrConfig(400, 400), "png");
        System.out.println(base64);
        // 二维码读取转base64图片流
        byte[] bytes = IoUtil.fileToByte(new File("/Users/kuuga/Downloads/qrcodeWithLogo.jpg"));
        String encode = Base64Util.encode(bytes);
        System.out.println("图片base64编码：" + encode);
        String base641 = QrCodeSeniorUtil.generateAsBase64("http://baidu.com/", new QrConfig(400, 400), "png", encode);
        System.out.println(base641);
    }

